"""
This module contains various lookup tables used in EES calculations. It is called indirectly through other functions in the eeslib package.
"""

from scipy import interpolate as __interp
import numpy as __np

def __load_matrix(s, unstructured=False):
    if unstructured:
        data = __np.array([__np.array([float(v) for v in r.split('\t')]) for r in s.split('\n')[1:]])
        # format assumed is x y z, with x y independent
        xmin = data.T[0].min()
        xmax = data.T[0].max()
        ymin = data.T[1].min()
        ymax = data.T[1].max()
        nx = len(list(set(data.T[0])))
        ny = len(list(set(data.T[0])))

        x = __np.linspace(xmin,xmax,nx)
        y = __np.linspace(ymin,ymax,ny)

        # Construct grid for interpolation basis
        xm,ym = __np.meshgrid(x,y)
        z = __interp.griddata((data.T[0],data.T[1]), data.T[2], (xm,ym), method='linear')

    else:
        data = __np.array([__np.array([float(v) for v in r.split('\t')]) for r in s.split('\n')])
        x = data[0,1:].copy(order='C')
        y = data[1:,0].copy(order='C')
        z = data[1:,1:].T.copy(order='C')
    return (x,y),z

def __load_multicol(s):
    data = __np.array([r.split('\t') for r in s.split('\n')])
    head = data[0,:]
    ddict = dict([head[i],__interp.RegularGridInterpolator([data[1:].T[0].astype(float)],data[1:].T[1].astype(float))] for i in range(1,len(head)))
    return ddict

